import React from 'react'
import logo from '../favicon.ico'

const Navbar = () => {
  return (
    <div className="main_">
      <div className="leftbox">
        <img src={logo} alt="" />
      </div>
      <div className="rightbox"></div>
    </div>
  )
}

export default Navbar
